import React, {useState} from "react";
import {Algorithm} from "./algorithm_interface";
import { motion } from "framer-motion";

export class MinHeap implements Algorithm {

    display() {

        return (
            <div>
                <TreeNode node={treeData} />
            </div>
        )
    }
}

const treeData = {
    name: "Root",
    children: [
        {
            name: "Child 1",
            children: [
                { name: "Child 1.1" },
                { name: "Child 1.2" }
            ]
        },
        {
            name: "Child 2",
            children: [
                { name: "Child 2.1" }
            ]
        }
    ]
};
